import mixin from 'blockchain-ui-privatization/PC/common-mixin/modules/coTrade/tradeForm/tradeForm';
import calculateVolumeMixin from 'blockchain-ui-privatization/PC/common-mixin/modules/coTrade/tradeForm/calculateVolume';
import 'blockchain-ui-privatization/PC/common-mixin/modules/coTrade/tradeForm/tradeForm.styl';
import formInput from '@/components/modules/coTrade/component/form-input.vue';
import forcedReminder from '@/components/modules/coTrade/component/forced-reminder.vue'; // 调整杠杆弹框

import leverComponent from '@/components/modules/coTrade/component/lever.vue'; // 保证金模式 全仓 逐仓 切换

import depositMode from '@/components/modules/coTrade/component/depositMode.vue';
export default {
  mixins: [mixin, calculateVolumeMixin],
  components: {
    formInput: formInput,
    forcedReminder: forcedReminder,
    leverComponent: leverComponent,
    depositMode: depositMode
  },
  mounted: function mounted() {
    this.init();
  },
  // 组价离开前执行
  beforeDestroy: function beforeDestroy() {
    clearInterval(this.assetsInter);
  }
};
